import React, { Component } from 'react';


class Image extends Component{


  constructor(props){
    super(props);
    this.fname = "./static/" + props.fname;
    this.size = props.size + "px";
    this.height= props.height + "px";
    this.width= props.width + "%";
    this.objectfit= props.objectfit;
    this.paddingleft= props.paddingleft+"%";
    this.paddingright= props.paddingright+"%";
  }


  render(){
    return (
      <img
        width={this.size} 
        src={this.fname}

         />
    );
  }
}
export default Image;
